import { chakra } from "@chakra-ui/react"

export const SMButton = () => {
    return(
        <chakra.button
            sx={{
                shadow: "lg",
                rounded: "lg",
                bg: "white",
            }}
        >
            Click me
        </chakra.button>
    )
}

module.exports = {
    SMButton
}
